export default () => (
  <Html lang="en">
    <Head>
      <title>Next POC Projects</title>
      <meta property="og:title" content="Next POC Projects" key="title" />
    </Head>
    <Header />
    <h1>Projects!!!</h1>
    <ul>
      <li>Projects!</li>
      <li>Projects!</li>
      <li>Projects!</li>
    </ul>
    <Footer />
  </Html>
);
